import React, { useState } from "react";

export default function CanalDenunciaForm() {
  const [formData, setFormData] = useState({
    SocNom: "",
    SocApe: "",
    SocMail: "",
    SocMail2: "",
    SocTel1: "",
    FecVal: "",
    OP2: "", // Personas comprometidas
    SocObs: "",
    Conocimiento: "", // Cómo se enteró
    SocOtroConocimiento: "",
    Lugar: "",
    SocNomotro: "",
    Relacion: "", // Relación con Bancrece
    OP: "NO", // SI / NO (denuncia anónima)
    fileToUpload: null,
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleFileChange = (e) => {
    setFormData({
      ...formData,
      fileToUpload: e.target.files[0],
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    for (let key in formData) {
      data.append(key, formData[key]);
    }

    try {
      const res = await fetch("http://localhost:3000/submit-form", {
        method: "POST",
        body: data,
      });

      const result = await res.json();
      alert(result.message);
    } catch (err) {
      console.error("Error al enviar:", err);
      alert("Error al enviar denuncia");
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Canal de Denuncias</h2>

      <input
        type="text"
        name="SocNom"
        placeholder="Nombre"
        value={formData.SocNom}
        onChange={handleChange}
        required
      />

      <input
        type="text"
        name="SocApe"
        placeholder="Apellido"
        value={formData.SocApe}
        onChange={handleChange}
        required
      />

      <input
        type="email"
        name="SocMail"
        placeholder="Correo"
        value={formData.SocMail}
        onChange={handleChange}
        required
      />

      <input
        type="email"
        name="SocMail2"
        placeholder="Confirmar correo"
        value={formData.SocMail2}
        onChange={handleChange}
        required
      />

      <input
        type="tel"
        name="SocTel1"
        placeholder="Teléfono"
        value={formData.SocTel1}
        onChange={handleChange}
        required
      />

      <textarea
        name="SocObs"
        placeholder="Descripción del hecho"
        value={formData.SocObs}
        onChange={handleChange}
        required
      ></textarea>

      {/* Relación con Bancrece */}
      <select
        name="Relacion"
        value={formData.Relacion}
        onChange={handleChange}
        required
      >
        <option value="">Seleccione Relación</option>
        <option value="1">Socio</option>
        <option value="2">Colaborador</option>
        <option value="3">Proveedor</option>
        <option value="4">Cliente</option>
        <option value="5">Otro</option>
      </select>

      {/* Lugar de ocurrencia */}
      <select
        name="Lugar"
        value={formData.Lugar}
        onChange={handleChange}
        required
      >
        <option value="">Seleccione lugar</option>
        <option value="1">Casa Matriz</option>
        <option value="2">Moneda</option>
        <option value="3">Regional</option>
        <option value="4">Sucursal</option>
        <option value="5">Otro</option>
      </select>

      {/* Cómo se enteró */}
      <select
        name="Conocimiento"
        value={formData.Conocimiento}
        onChange={handleChange}
        required
      >
        <option value="">Seleccione</option>
        <option value="1">Directamente</option>
        <option value="2">Terceros</option>
        <option value="3">Documentos</option>
        <option value="4">Otro</option>
      </select>

      <input
        type="text"
        name="SocOtroConocimiento"
        placeholder="Otro (si corresponde)"
        value={formData.SocOtroConocimiento}
        onChange={handleChange}
      />

      {/* Personas comprometidas */}
      <select
        name="OP2"
        value={formData.OP2}
        onChange={handleChange}
        required
      >
        <option value="">¿Personas comprometidas?</option>
        <option value="SI">Sí</option>
        <option value="NO">No</option>
        <option value="NOS">No sé</option>
      </select>

      {/* Denuncia anónima */}
      <select name="OP" value={formData.OP} onChange={handleChange} required>
        <option value="SI">Anónima</option>
        <option value="NO">Con datos</option>
      </select>

      {/* Archivo adjunto */}
      <input
        type="file"
        name="fileToUpload"
        onChange={handleFileChange}
      />

      <button type="submit">Enviar denuncia</button>
    </form>
  );
}
